-- #  Module Object  # --

local mod = {}
mod.__index = mod

AccessorFunc(mod,"f_name","Name")
AccessorFunc(mod,"f_short","Short")
AccessorFunc(mod,"f_desc","Description")
AccessorFunc(mod,"f_func","Function")
AccessorFunc(mod,"f_state","State")


-- #  API  # --


function GFetch:AddModule(name,short)
	self.Modules[short] = setmetatable({},mod)
	self.Modules[short]:SetName(name)
	self.Modules[short]:SetShort(short)

	
	return self.Modules[short]
end
 
function GFetch:AddCommand(full,short,desc,func,blocking)
	-- This is super jank but also kinda efficient so stfu
	self.Commands[full] = {shortened=short,description=desc,func,blocking}
	self.Commands[short] = {expanded=full,func,description=desc,blocking}
end


-- #  Init # --

for _,v in pairs(file.Find("gfetch_modules/*.lua", "LUA")) do
	if CLIENT then
		include("gfetch_modules/"..v)
	else
		include("gfetch_modules/"..v)
		AddCSLuaFile("gfetch_modules/"..v)
	end
end

-- #  Argument Parser  # --

local function around(num,max)
	if num > max then
		num = num - max
	end
	return num 
end

