	local help = {
		["Usage"] = {
			[""] = {{},"Runs GFetch with all modules and the theme '"..options.colsetname.."'"},
			["-t spotify"] = {{2,1},"Runs GFetch with the theme 'spotify'"},
			["-t spotify ip os"] = {{2,1,2,2}, "Runs GFetch with the theme 'spotify' and without the modules 'ip' and 'os'"}
		},
		["Commands"] = {}
	}
	for name,v in pairs(GFetch.Commands) do
		if v.shortened then
			help["Commands"][v.shortened.." | "..name] = {{2,1,2},v.description,true}
		end
	end

	for name,v in pairs(help) do
		MsgC(theme[1],"\n",name,":\n")
		for args,vals in pairs(v) do
			if !vals[3] then 
				MsgC(theme[3],"		gfetch ")
			else
				MsgC(theme[3],"		")
			end
			for i,arg in pairs(string.Split(args, " ")) do 
				MsgC(theme[vals[1][i]] or theme[1], arg," ")
			end
			MsgC(theme[2],"\n 			   ",vals[2],"\n")
			print("")
		end
	end

	local comm = theme[2]
	local tip = Color(240,240,240)
end

