			MsgC(theme[1],"		",name,"\n")
		end
		return true
	end
end, false)

local function argparse(argstr)
	local tbl = string.Split(argstr," ")
	local toret = {
		blocking=false,
		hide={},
		colset=GFetch.ColorSets["manjaro"],
		colsetname="manjaro",
		map=game.GetMap(),
		tocopy=false
	}
	for k,v in pairs(tbl) do
		if GFetch.Commands[v] then
			local t = GFetch.Commands[v][1](toret,tbl[k+1])
			toret.hide[k+1] = true
			if GFetch.Commands[v][2] or t then
				toret.blocking = true
			end
		elseif GFetch.Modules[v] then
			toret.hide[v] = true		
		elseif v != "" and !toret.hide[k] then
			if v:sub(1,1) == "-" then
				MsgC(toret.colset[1],"Unknown Command '",v,"'\n")
			else
				MsgC(toret.colset[1],"Unknown Module '",v,"'\n")
			end
		end
	end
	return toret
end


-- #  Map Image  # --

local fill = "───────────────────────────────────────────────────────────────────────────────────────────────────────────"

local function calclen(map)
	local len = 0
	for _,v in pairs((GFetch.Maps[map] or GFetch.Maps["unknownmap"])[1]) do
		if isstring(v) then
			len=len+#v
		end
	end
	return len
end

local function mapparse(args,prn,cols)
	local len = calclen(args.map)
	local fill = fill:sub(-len)
	MsgC(cols[3],"┌",fill,"┐\n")
	for k,v in pairs(GFetch.Maps[args.map] or GFetch.Maps["unknownmap"]) do
		if #v != 0 then 
			MsgC(cols[3],"│",unpack(v))
			if prn[k] then 
				local txt = prn[k]:GetFunction()()
				if !(txt == nil) then 
					MsgC(cols[3],"├   ",cols[1],prn[k]:GetName(),cols[2],": ",txt,"\n")
				else
					MsgC(cols[3],"│   \n")
				end
			else
				MsgC(cols[3],"│\n")
			end
		end
	end
	MsgC(cols[3],"└",fill,"┘\n")

end



-- #  ConCommand  # --

concommand.Add("gfetch",function(_,_,_,argstr)
	local args = argparse(argstr)
	local colset = args.colset
	local prn = {}

	if !args.blocking then
		for name,obj in pairs(GFetch.Modules) do
			if !args.hide[name] and obj:GetState() != false then
				table.insert(prn,obj)
			end
		end
		mapparse(args,prn,colset)
	end
	print("\n\n")
end, function(cmd,args)
	local _args = args:Trim():lower():Split(" ")
	local arg = _args[#_args] 
	local toret = {}
	
	local arg1 = arg:sub(1,1) == "-" 
	local arg2 = arg:sub(2,2) == "-" 
	
	if arg1 and arg2 then
		for name,obj in pairs(GFetch.Commands) do
			if name:sub(1,1) == "-" and name:sub(2,2) == "-" then 
				table.insert(toret,cmd.." "..name)
				if obj.description and arg == name then 
					table.insert(toret,"└ "..obj.description) 
				end
			end
		end
	elseif arg1 then
		for name,obj in pairs(GFetch.Commands) do
			if name:sub(1,1) == "-" and !(name:sub(2,2)=="-")  then 
				table.insert(toret,cmd.." "..name)
				if obj.description and arg == name then 
					table.insert(toret,"└ "..obj.description) 
				end
			end
		end
	else
		table.insert(toret,"↓ Modules ↓") 
		for _,v in pairs(GFetch.Modules) do
			if v:GetShort():lower():StartWith(arg:lower()) or arg:lower():Trim() == "modules" then
				table.insert(toret," "..cmd.." "..v:GetShort()) 
			end
		end
		table.insert(toret,"↓ Themes ↓") 
		for name,v in pairs(GFetch.ColorSets) do
			if name:lower():StartWith(arg:lower()) or arg:lower():Trim() == "themes" then
				table.insert(toret," "..cmd.." -t "..name) 
			end
		end
	end

	return toret
end )

